import "./App.css";
import Sidebar from "./components/Sidebar";
import Chat from "./components/Chat";
import { Route, Switch, Redirect } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <div className="app_body">
        <Switch>
          <Route path="/" exact>
            <Redirect to="/login" />
          </Route>
          <Route path="/login">
            <h1>login page appears here</h1>
          </Route>
          <Route path='/rooms'>
            <Sidebar />
          </Route>
          <Route path="/rooms/:roomId">
            <Sidebar />
            <Chat />
          </Route>
          <Route path="*">
            <h1>Invalid URL</h1>
          </Route>
        </Switch>
      </div>
    </div>
  );
}

export default App;
